import React from 'react';

const ExperienceList = function(props) {
    console.log(props, 'props from experiences')
    return(
        <div>
            {props.experiences.map(experience => (
                <div>
                <p><strong>Title</strong>{experience.title}</p>
                <p><strong>Date</strong>{experience.title}</p>
                <p><strong>Location</strong>{experience.title}</p>
                <p><strong>Description</strong>{experience.title}</p>
                <p><strong>Price</strong>{experience.title}</p>
                <p><strong>Image</strong>{experience.title}</p>

                </div>
            ))}
        </div>
    )
}

export default ExperienceList;
